import PrivateAdminRoute from './components/PrivateAdminRoute';

import ManageFlights from './pages/ManageFlights';
import ManageHotels from './pages/ManageHotels';
import AdminDashboard from './pages/AdminDashboard';
import AdminLogin from './pages/AdminLogin';
import './App.css';

import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Flights from './pages/Flights';
import Login from './pages/Login';
import Register from './pages/Register';
import Hotels from './pages/Hotels';
import UserBookings from './pages/UserBookings';

import { Container, Navbar, Nav } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <Navbar bg="primary" variant="dark" expand="lg">
        <Container>
          <Navbar.Brand as={Link} to="/">MakeMyTrip Clone</Navbar.Brand>
          <Nav className="ms-auto">
            <Nav.Link as={Link} to="/flights">Flights</Nav.Link>
            <Nav.Link as={Link} to="/hotels">Hotels</Nav.Link>
            <Nav.Link as={Link} to="/login">Login</Nav.Link>
            <Nav.Link as={Link} to="/register">Register</Nav.Link>
            <Nav.Link as={Link} to="/user-bookings">User Bookings</Nav.Link>
            <Nav.Link as={Link} to="/admin/login">Admin</Nav.Link>
            {localStorage.getItem('adminToken') && (
              <Nav.Link as={Link} to="/admin/dashboard">Admin Dashboard</Nav.Link>
            )}
          </Nav>
        </Container>
      </Navbar>

      <Container className="my-4">
        <Routes>
          <Route path="/" element={<h1>Welcome to MakeMyTrip Clone</h1>} />
          <Route path="/flights" element={<Flights />} />
          <Route path="/hotels" element={<Hotels />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/user-bookings" element={<UserBookings />} />
          <Route path="/admin/login" element={<AdminLogin />} />
          
          {/* âœ… Admin routes protected */}
          <Route path="/admin/dashboard" element={
            <PrivateAdminRoute><AdminDashboard /></PrivateAdminRoute>
          } />
          <Route path="/admin/flights" element={
            <PrivateAdminRoute><ManageFlights /></PrivateAdminRoute>
          } />
          <Route path="/admin/hotels" element={
            <PrivateAdminRoute><ManageHotels /></PrivateAdminRoute>
          } />
        </Routes>
      </Container>
    </Router>
  );
}

export default App;
